import React from 'react';
import About from '../About';
import Test from '../Test';
import { NavLink } from 'react-router-dom';
const Navigation = () => {
    return (
        <div>
            <li>
                <ul>
                    <NavLink to={<test />}>
                        <li>About</li>
                    </NavLink>
                    {/* <NavLink to={<test />}>Test</NavLink> */}
                </ul>
            </li>
        </div>
    );
};

export default Navigation;
